import React from "react";
import './Login.style.css'
import Navbar from "../../components/layouts/navbar/Navbar";
import AuthBgImg from '../../assets/auth_bg.jpg';
import AuthForm from "../../components/Forms/authForm/AuthForm";
import {Link} from 'react-router-dom';
const Login = () => {
    return (
        <>
        <Navbar darkTheme={true}/>
        <section className="login-container">
            <div className="login-img-container">
                <img src={AuthBgImg} alt="authentication-background"/>
            </div>

            <form>
                <label>USERNAME</label>
                <input className="inputUserName" type="text" placeholder="Enter your username" />
                <label>PASSWORD</label>
                <input className="inputPassword" type="password" placeholder="Enter your password" />
                <button type="submit"> Continue </button>
            </form>
            <div className="login-register"> Don't have an account yet? </div>
            <Link className="login-register-link" to="/register">Register one for free </Link>
        </section>
        </>
    )
}

export default Login;
